import React from "react";

export default function Profile(props) {
  const { currentUser } = props;

  if (!currentUser) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <p>Username: {currentUser.username}</p>
      <p>Email: {currentUser.email}</p>
      <p>Password: {currentUser.password}</p>
      <button>Edit</button>
    </div>
  );
}
